/* STORAGE ENTERPRISE Context - Tension: 50% (stable) */
.storage-enterprise {
  /* Core Colors */
  --hsl-color: hsl(60, 70%, 50%);
  --hex-color: #D9D926;
  --tension-gradient: linear-gradient(135deg, 
      hsl(60, 80%, 60%), 
      hsl(30, 80%, 40%)
    );
  --tension-level: 50;
  --tension-trend: stable;
  --tension-status: Stressed;

  /* Color Scheme */
  --color-primary: #D9D926;
  --color-secondary: #2E2EB8;
  --color-accent: #30E8E8;
  --color-background: #f0fff4;
  --color-text: #14532d;

  /* RGB Values */
  --color-rgb: 217, 217, 38;

  /* Color Palette */
  --color-palette-50: #F6F6EE;
  --color-palette-100: #F5F5C7;
  --color-palette-200: #EFEFA4;
  --color-palette-300: #E9E981;
  --color-palette-400: #E3E35F;
  --color-palette-500: #DDDD3C;
  --color-palette-600: #CCCC24;
  --color-palette-700: #B3B314;
  --color-palette-800: #8E8E10;
  --color-palette-900: #6A6A0C;

  /* Status-based Classes */
  --status-healthy: none;
  --status-stable: none;
  --status-stressed: block;
  --status-critical: none;
}

/* Utility Classes for storage-enterprise */
.storage-enterprise.tension-visual {
  background: var(--tension-gradient);
  color: var(--color-text);
  padding: 8px 16px;
  border-radius: 6px;
  font-weight: 500;
}

.storage-enterprise.status-indicator::before {
  content: 'ğŸŸ ';
  margin-right: 8px;
}

.storage-enterprise.tension-bar {
  height: 8px;
  background: #e5e7eb;
  border-radius: 4px;
  overflow: hidden;
}

.storage-enterprise.tension-bar::after {
  content: '';
  display: block;
  height: 100%;
  width: calc(var(--tension-level) * 1%);
  background: var(--tension-gradient);
  transition: width 0.3s ease;
}

.storage-enterprise.palette-demo {
  display: flex;
  gap: 2px;
  margin: 8px 0;
}

.storage-enterprise.palette-demo > div {
  flex: 1;
  height: 20px;
  border-radius: 2px;
}

